namespace Shine
{
	/** 副本状态类型(generated by shine) */
	export class BattleStateType
	{
		/** 等待中(一个人都没有) */
		public static Wait:number=1;
		
		/** 进入阶段(进入第一人到倒计时结束) */
		public static Enter:number=2;
		
		/** 预备(321倒计时) */
		public static Pre:number=3;
		
		/** 运行中 */
		public static Running:number=4;
		
		/** 已完成(完成到结算倒计时) */
		public static Over:number=5;
		
		/** 已结算(结算到清场倒计时) */
		public static Result:number=6;
		
		/** 已清场(待销毁) */
		public static End:number=7;
		
		/** 长度 */
		public static size:number=8;
		
	}
}
